import React from "react";

const Footer = () => {
  return (
    <footer
      style={{ textAlign: "center", padding: "1em", background: "#f1f1f1" }}
    >
      <p>Created by: John Doe and Jane Smith</p>
    </footer>
  );
};

export default Footer;
